import React from "react";

class Customer extends React.Component{
    render(){
        return(
            <div>
                <p>{this.props.rank}</p>
                <img src={this.props.image} alt="profile"/>
                <h2>{this.props.name}</h2>
                <p>{this.props.table}</p>
                <p>{this.props.time}</p>
            </div> 
        )
    }
}

export default Customer
